import { Pie, mixins } from 'vue-chartjs'
const { reactiveProp } = mixins;

export default {
    extends: Pie,
    mixins: [reactiveProp],
    props: ['options'],
    mounted () {
        console.log("PIE CHARTIS DATA: ");
        console.log(this.chartData);
        this.renderChart(this.chartData, this.options)
    }
}
